 import Map from 'ol/Map.js';
 import View from 'ol/View.js';
 import Feature from 'ol/Feature';
 import GeoJSON from 'ol/format/GeoJSON.js';
 import Geometry from 'ol/geom/Geometry';
 import {Draw, Modify, Snap} from 'ol/interaction.js';
 import {Tile as TileLayer, Vector as VectorLayer} from 'ol/layer.js';
 import {OSM, Vector as VectorSource, Stamen} from 'ol/source.js';
 import {Circle as CircleStyle, Fill, Stroke, Style} from 'ol/style.js';
 import { fromLonLat } from 'ol/proj';
 

function test(data) {
var natures = JSON.parse(data);
var nature = (natures[2].nature)
console.error(nature);

var couleur = function (p) {
    if (p == "Parcelle bÃ¢tie") {
      return [200, 102, 102, 1]
    } else if (nature == "Parcelle non bÃ¢tie") {
      return [255, 173, 102, 1]
    } else {
      return [128, 128, 128, 1]
    }
  }

  var raster =new TileLayer({
    source: new Stamen({
      layer: 'terrain'
    })
  });
  var source = new VectorSource({
    format: new GeoJSON(),

    features: [],
//  source : source
  });
  var foncier2 = new VectorLayer({
    source:source,
    
    style: function (feature, res) {
      var natures = JSON.parse(data);
      var nature = (natures[2].nature)
      console.error(nature);
      var property = nature;
      return new  Style({
        stroke: new Stroke({
          color: [40, 40, 40, 1],
          width: 0.3
        }),
        fill: new Fill({
          color: couleur(property)
        })
      })
    },
  

    source: source,
    
        style: new Style({
          fill: new Fill({
            color: 'rgba(255, 255, 255, 0.2)'
          }),
          stroke: new Stroke({
            color: '#ffcc33',
            width: 2
          }),
        })
  });



  

  // déclaration de la carte
  var map = new Map({
      layers: [raster,foncier2],
    target: 'map',
    view: new View({
       dataProjection: 'EPSG:4326',
       featureProjection: 'EPSG:3857',
      // center: [0, 0],
      // zoom: 2
      center: fromLonLat([2, 48]),
      zoom: 6
    }),    
  });
  
  //Interaction avec la carte
  map.addEventListener("click", function (evt) {
    map.forEachFeatureAtPixel(evt.pixel, function (feature, layer) { 
    // Création de la liste de nature des parcelles 
      var Nature = ['Zone AU', 'Parcelle bÃ¢tie','Parcelle non bÃ¢tie'];
  // On initialise notre compteur à 0
  var i = 0;
      // On assigne la nature de la parcelle cliqué par l'utilisateur dans la variable temp_Nature
     var temp_Nature = document.getElementsByTagName('option')[0].selected = feature.get("nature");
     document.getElementsByTagName('select')[0].options[i].innerHTML = temp_Nature;
      // On ajoute cette nature en première position de la liste Nature
      Nature.splice(0, 0, temp_Nature);
      // On parcours notre liste
      Nature.forEach(function(item, index, array) {
         // Pour chaque item de la liste nature on se demande si l'item est différent de la parcelle cliqué par l'utilisateur
        if (item != temp_Nature){
          // On augmente notre compteur qui va nous servir à quelle position on affiche les autres natures de la parcelle
          i = i +1 
          // On affiche la nature parcellaire différent  de la parcelle cliqué par l'utilisateur
          document.getElementsByTagName('select')[0].options[i].innerHTML = (item);
        }
      });
      // Récupération des champs et affichages des champs au niveau de leur ID défini dans le fichier HTML
       document.getElementsByTagName("placeholder").innerHTML = feature.get("nbr_lgmt");
     document.getElementById("logement").innerHTML = feature.get("nbr_lgmt");
  
  
      document.getElementById("localisation").innerHTML = feature.get("libgeo");
      document.getElementById("id_parc").innerHTML = feature.get("id");
  
      
    })
  });


    
  // function loadJSON(callback) {
