  function loadFeatures(data) {
   var myData = JSON.parse(data);
var test= JSON.parse(myData[2].geom);
   var geojsonObject = {
    "type": "FeatureCollection",
    "crs": { "type": "name", "properties": { "name": "EPSG:3857" }},
    "features": [
      {
        "type": "Feature",
        "geometry": {
          "type": test.type,
          "coordinates": test.coordinates
        }
      }
    ]};
   
  //  var feature = new Feature();
  //  writeGeometry(myData);
  //  var myData=feature.getGeometry();


    //Inserez ici votre code de traitement de la donnee
    //Elle se traite comme pour n'importe quel objet json
    // console.error( foncier2.getSource().getFormat().readFeatures(geojsonObject));
    foncier2.getSource().clear();
    foncier2.getSource().addFeatures(foncier2.getSource().getFormat().readFeatures(geojsonObject, {
      dataProjection: 'EPSG:4326',
      FeatureProjection: 'EPSG:3857',
    }));
    foncier2.getSource().refresh();
    foncier2.getSource().changed();
